import React from 'react';
import './App.css';

type State = typeof initState;

const initState = {
  state: "aaa" as string
}
class App extends React.Component<{},State>{
  state = initState;

  render(){
    return(
      <div className="App">
      <h1>{this.state.a.id}</h1>
      </div>
    );
  }
}

export default App;
